import Hero from "./Hero";
import About from "./About";
import Contact from "./Contact"

export default function Home() {
  return (
    <main>
      <section id="hero">
        <Hero />
      </section>
      <About id="about" />
      <Contact id="contact" />
    </main>
  );
}
